    React.useEffect(() => {
        axios.get(baseUrl + "/groups").then((response) => {
            setPost(response.data);
        });
    }, []);

    return (
        <div>
            <NavBar/>
            <div className = "row">
                <LeftNavbar/>
                <table className="table col-9">
                    <thead>
                        <tr>
                            <th scope="col">#</th>
                            <th scope="col">Name</th>
                        </tr>
                    </thead>
                    <Products></Products>
                </table>
            </div>
        </div>
    );
}
